import Link from 'next/link'

export default function Header() {
  return (
    <div style = {headerStyle}>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/projects">
        <a>Projects</a>
      </Link>
      <Link href="/designs">
        <a>Designs</a>
      </Link>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
      <style jsx>{`
        a {
          margin: 2rem;
          text-decoration: none;
          color: #3D3D3D;
          font-family: 'Arial';
        }

        a:hover {
          opacity: 0.6;
        }

        `}</style>
    </div>
  )
}
